script: |
  super -f text -I q5330.spq | sort > q5330.out

inputs:
  - name: q5330.spq
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT col1 + col2 / - col2 IN ( + col2 * - col1 / col2 );
  - name: tab1

outputs:
  - name: q5330.out
    data: |
      3
      64
      80
